const SquadColors = ({ setSquadColors }) => {
  return (
    <div>
      <div className="content">
        <p className="title">Select team design</p>
        <div className="btn" onClick={() => setSquadColors(5)}>
          Base color
        </div>
        <div className="btn" onClick={() => setSquadColors(5)}>
          Second color
        </div>
      </div>
    </div>
  );
};

export default SquadColors;
